import React from 'react';
import styled from 'styled-components'

const Postings = (props)=>{
    return(

            <PropWrapper>
            <Text>{props.Title}</Text>
            </PropWrapper>

    )
}

export default Postings


const PropWrapper = styled.section`
border: 1px solid blue;

`


const Text = styled.p`
color:white;
`;
